local ST_AUTHOR           = 'Darksecond'
local FUSE_NAME           = 'Mosaic'
local FUSE_PATH           = 'Shadertoys_beta/AbstractShader/'
local FUSE_FILENAME       = 'Mosaic.fuse'
local FUSE_COPYRIGHT      = ''
local FUSE_AUTHOR         = 'JiPi'
local FUSE_AUTHORURL      = 'https://www.youtube.com/channel/UCItO4q_3JgMVV2MFIPDGQGg'
local FUSE_VERSION        = 'v1'
local FUSE_THUMB          = ''
local FUSE_AUTHORIMG= ''
