    WindowTitle = FUSE_NAME..' Installer',
    Geometry    = g_geometry,
    Spacing     = 10,

    g_ui:VGroup {

      ID = 'root',

      g_ui:HGroup {
        g_ui:Label{
          ID = "", WordWrap = false, Weight = 0,
          MinimumSize = {320, 180}, ReadOnly = true, Flat = true,
          Alignment = { AlignHCenter = false, AlignTop = true, },
          Text = '<img src="data:image/png;base64,'.. FUSE_THUMB .. '" />',
